function toSpinalCase(e){return e=e||this,e.replace(/(?!^)([A-Z])/g," $1").replace(/[_\s]+(?=[a-zA-Z])/g,"-").toLowerCase()}function toCamelCase(e){return e=e||this,e.replace(/^([A-Z])|\s(\w)/g,function(e,t,a){return a?a.toUpperCase():t.toLowerCase()})}String.prototype.toSpinalCase=toSpinalCase,String.prototype.toCamelCase=toCamelCase;